    useEffect(()=>{
        fetch('3001/api').then(res => {
            if(res.ok) {
                return res.json()
            }
        }).then(jsonResponse => setInitialState(jsonResponse))
    },[])
    console.log(initialState)
    return(<div>Hello</div>)
}
